syntax = "proto3";
import "options.proto";

option java_package = "gg.rsmod.proto.messages.incoming";
option java_multiple_files = true;

message ResumePStringDialogMessage {
    option (rsmod.header).opcode = 8;
    option (rsmod.header).type = VariableByte;

    string input = 1 [(rsmod.type) = String];
}